import './../Style/History.css';
import { useState, useEffect } from "react";
import {variables} from "../Variables";
import React from 'react';
import Swal from 'sweetalert2'
import withReactContent from 'sweetalert2-react-content'

function AppHistory(){
    const [order, setOrder] = useState([]);

    useEffect(() => {
        fetch(variables.API_URL+"get_order_user/"+localStorage.getItem("id"), {
            method: "GET",
            headers: {
                'Accept': 'application/json, text/plain',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            })
            .then(response => response.json())
            .then(result => {
                console.log(result)
                setOrder(result)
            }
        )
    }, []);

    async function handleOrderDetail(e, value){
        const MySwal = withReactContent(Swal);
        for (let index = 0; index < order.length; index++) {
            const element = order[index];
            if(element.order_id === value){
                MySwal.fire({
                    html: <>{element.order_detail}</>,
                    confirmButtonColor: "#F07221"
                }).then(() => {
                    // window.location.reload(false);
                })
            }
        }
    }

    if(order.length > 0){
        const order_list = order.map((item, index) => (
            <tr key={index}>
              {/* <td>{item.order_id}</td> */}
              <td><button onClick={(e)=>{handleOrderDetail(e, item.order_id)}}> Click to See Detail </button></td>
              <td>{item.create_time.replace("T", " ").replace(".000Z", " ")}</td>
              <td>{item.status}</td>
              <td>-</td>
            </tr>
          ));

    return(
    <div className="history">
        <h1>User Service History</h1>
        <div className='history-table'>
            <table>
                <thead>
                    <tr>
                        <th>Deatils</th>
                        <th>Date Time</th>
                        <th>Status</th>
                        <th>To Review</th>
                    </tr>
                </thead>
                <tbody>
                    {order.length !== 0?order_list:''}
                </tbody>
            </table>
        </div>
    </div>
    );
    }
}

export default AppHistory;
